import React from 'react';
import {Navbar,Container, NavLink, NavItem} from 'react-bootstrap';
import { Link } from 'react-router-dom';

const navbar = ({title}) => {

  return (
    <div>
      <Navbar expand="lg" className='bg-primary justify-content-between'>
   
        <Container className='' style={{justifyContent:"space-between"}}> 
        <Navbar.Toggle className='ms-auto'/>
        <Navbar.Collapse id="basic-navbar-nav" className='nav ms-auto' style={{padding:"20px 32px", justifyContent:'space-around' }}>
         <NavItem>
         <Link to="/home" style={{color:"red"}}>Home</Link>
         </NavItem>
         <NavItem>
         <Link to="/about" style={{color:"red"}}>About</Link>
         </NavItem>
        <NavItem>
         <Link to="/contact"  style={{color:"red"}}>Contact</Link>
        </NavItem>

          </Navbar.Collapse>
        </Container>
   
      </Navbar>
    </div>
  )
}

export default navbar;
